import React from "react";
import"./style.css";

const BookContainer = (props) => {
    return  (
        <div className="book-container">
            <div className>
                <h2>Results</h2>
            </div>
            {props.children}
            <button className="btn-view">View More <div className="btn-view__down-arrow"/></button>
        </div>
    );
}

export default BookContainer;
